import styles from "./Registration.module.scss";


import React from 'react';

import {Link} from 'react-router-dom'; 
import axios from "axios";
import { useNavigate } from "react-router-dom";

function Registration() {

  const [name, setName] = React.useState(``);
  const [lastName, setlastName] = React.useState(``);
  const [patronymic, setPatronymic] = React.useState(``);
  const [email,setEmail] = React.useState(``);
  const [localityShipping,setLocalityShipping] = React.useState(``);
  const [addressShipping,setAddressShipping] = React.useState(``);
  const [postcode,setPostcode] = React.useState(``);
  const [password1,setPassword1] = React.useState(``);
  const [password2,setPassword2] = React.useState(``);
  const navigate = useNavigate();

  const onSubmit = (event)=>{
    event.preventDefault();
    if(password1!==password2){
      setPassword1
    }
    axios.post('http://localhost:5555/auth/register',{
      name: name,
      lastName: lastName,
      patronymic: patronymic,
      email: email,
      password: password,
      localityShipping: localityShipping,
      addressShipping: addressShipping,
      postcode:postcode
    }).then(res=>{
      alert('Register')
      navigate("/login");
    })
  }

  return (
    <div className={styles.content}>
      <h2>Регистрация</h2>
      <form onSubmit={onSubmit}>
        <input
          class="text"
          type="text"
          name="lastName"
          placeholder="Фамилия"
          required=""
          onChange={(event)=>{
            setlastName(event.target.value)
          }}
        />
        <input
          class="text"
          type="text"
          name="name"
          placeholder="Имя"
          required=""
          onChange={(event)=>{
            setName(event.target.value)
          }}
        />
        <input
          class="text"
          type="text"
          name="patronymic"
          placeholder="Отчество (при наличии)"
          onChange={(event)=>{
            setPatronymic(event.target.value)
          }}
        />
        <input
          class="text"
          type="text"
          name="email"
          placeholder="Email"
          required=""
          onChange={(event)=>{
            setEmail(event.target.value)
          }}
        />
        <input
          class="text"
          type="text"
          name="localityShipping"
          placeholder="Город"
          required=""
          onChange={(event)=>{
            setLocalityShipping(event.target.value)
          }}
        />
        <input
          class="text"
          type="text"
          name="addressShipping"
          placeholder="Адрес"
          required=""
          onChange={(event)=>{
            setAddressShipping(event.target.value)
          }}
        />
        <input
          class="text"
          type="text"
          name="postcode"
          placeholder="Почтовый индекс"
          required=""
          onChange={(event)=>{
            setPostcode(event.target.value)
          }}
        />
        <input
          class="text"
          type="password"
          name="password"
          placeholder="Введите пароль"
          required=""
          onChange={(event)=>{
            setPassword1(event.target.value)
          }}
        />
        <input
          class="text"
          type="password"
          name="password"
          placeholder="Повторите пароль"
          required=""
          onChange={(event)=>{
            setPassword2(event.target.value)
          }}
        />
 <div className={styles.buttons}>
        <button className={styles.orangeButton}>Создать аккаунт</button>
        <Link to='/login'> <button className={styles.yellowButton}> Войти в аккаунт</button></Link>
      </div>
      </form>

    </div>
  );
}
export default Registration;
